        console.log(offSetScreen);
        if(offSetScreen > 200){
            Navbar.classList.add("teste");
        }    
    };

    

    return (
        <div className="Navbar">
            <div className="LogoBox">
                <img className="LogoImage"/>
            </div>
            <div className="UBox">
                <ul>
                    <li>In√≠cio</li>
